import React, { Component } from 'react';
import classes from './SplitScreen.module.css';
import TBS from './Logo_tbs.png';
import Ecole from './logo_42.png'

class SplitScreen extends Component {
  render() {
    return (
      <section id="wrapper" className="skewed" className={classes.wrapper}>

          <div className={classes.layer_bottom, classes.bottom}>
            <div className={classes.content_wrap}>
              <div className={classes.content_body}>
                <h1 className={classes.layer_bottomh1} >Business School</h1>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Aut quisquam temporibus dolore vero reiciendis atque debitis. Sequi at consequatur deserunt?</p>
              </div>
              <img src={TBS} alt="logo"/>
            </div>
          </div>

            <div className={classes.layer_top}>
              <div className={classes.content_wrap}>
                <div className={classes.content_body}>
                  <h1 className={classes.layer_bottomh1}>Dev School</h1>
                  <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Aut quisquam temporibus dolore vero reiciendis atque debitis. Sequi at consequatur deserunt?</p>
                </div>
                <img src={Ecole} alt="logo" className={classes.layer_img} />
              </div>
            </div>

            <div className={classes.handle}></div>
        </section>
    );
  }
}

export default SplitScreen;
